import { useEffect, useState } from "react";

const GetData = () => {
    const fetchData = async () => {
      try {
        const response = await fetch("./data.json");
        const jsonData = await response.json();
        setData(jsonData);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();

  return data;
};

export default GetData;
